	add("electricity", "{\"term\":\"electricity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|electric|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of electrical energy; the branch of science dealing with such phenomena\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Jon Henley, \u0027The Guardian\u0027, 29 Mar 2011\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"How does it work, though? It\u0027s based on the observation made some 200 years ago that \u0027\u0027electricity\u0027\u0027 can change the shape of flames\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Electric power/energy as used in homes etc., supplied by power stations or generators\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, James Meek, \u0027[http://www.guardian.co.uk/renewable/Story/0,2763,363461,00.html Home-made answer to generating electricity harks back to the past]\u0027, \u0027The Guardian\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Householders could one day be producing as much \u0027\u0027electricity\u0027\u0027 as all the country\u0027s nuclear power stations combined, thanks to the revolutionary application of a device developed in the early 19th century\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/http://www.economist.com/news/asia/21582043-villagers-enjoy-sunlight-after-dark-out-gloom Out of the passage\u003d[Rural solar plant] schemes are of little help to industry or other heavy users of \u0027\u0027electricity\u0027\u0027. Nor is solar power yet as cheap as the grid. For all that, the rapid arrival of electric light to Indian villages is long overdue. When the national grid suffers its next huge outage, as it did in July 2012 when hundreds of millions were left in the dark, look for specks of light in the villages\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Electric charge, or particles carrying such charg\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1747\u0027\u0027, letter, 28 Jul 1747\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Restoring the equilibrium in the bottle does not at all affect the \u0027\u0027Electricity\u0027\u0027 in the man\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, William Leithead, \u0027Electricity\u0027, p. 5\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Attraction, then, is the first phenomenon that arrests our attention, and it is one that is constantly attendant on excitation. It is therefore considered a sure indicator of the presence of \u0027\u0027electricity\u0027\u0027 in an active state, and forms the basis of all its tests\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1873\u0027\u0027, \u0027s:A Treatise on Electricity and Magnetism/Part I/Chapter A Treatise on Electricity and Magnetism\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"We may express all these results in a concise and consistent manner by describing an electrified body as \u0027charged\u0027 with a certain \u0027quantity of \u0027\u0027electricity\u0027\u0027\u0027, which we may denote by \u0027e\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A feeling of excitement; a thrill\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A property of amber and certain other nonconducting substances (\u0026quot;electricks\u0026quot;) to attract lightweight material when rubbed, or the cause of this property; now understood to be an imbalance of electric charge\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, \u0027Pseudodoxia Epidemica\u0027, 1st edition, p. 51\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The concretion of Ice will not endure a dry attrition without liquation; for if it be rubbed long with a cloth, it melteth. But Crystal will calefie unto \u0027\u0027electricity\u0027\u0027; that is, a power to attract strawes and light bodies, and convert the needle freely placed\", \"priority\":18}]}, \"synonyms\":{}}");

